Αν ο Κουφοντίνας συμπεριφερόταν διαφορετικά εκείνο το βράδυ, ποια θα ήταν η εξέλιξη;
[Του Τάσου Παππά]
https://t.co/8XBAc7AVO3

Πόση δύναμη έχουν, τέλος πάντων, τα social media, πόσο ανθρωποφάγα μπορούν να γίνουν, ιδιαίτερα όταν κάποιος είναι «απών», έχει φύγει από τη ζωή και δεν μπορεί να υπερασπιστεί τον εαυτό του;
[Της Παρή Σπίνου]
https://t.co/WqFNCEV2g8

Ο Μάνφρεντ Βέμπερ παίρνει τον λόγο και χαρακτηρίζει «αριστερούς λαϊκιστές» όσους ψήφισαν Μελανσόν στη Γαλλία. Επεσε γιουχάισμα υπέροχο... Τώρα, να χαρώ ή να την πάθω την ολική συμφόρηση;
[της Νόρας Ράλλη]
https://t.co/vaK3SI8brG

Αυτό που έγινε δεν είναι μόνο δημοσιογραφική αθλιότητα, είναι και η 108η θέση στον κόσμο στην Ελευθερία του Τύπου. Δεν πρέπει να αντιδράσουμε;
[του Δημήτρη Κανελλόπουλου]
https://t.co/SYunsagCpp

Η μπλόφα για να είναι εργαλείο πολιτικής δεν πρέπει να είναι μόνο μπλόφα. Τι είδους μπλόφα είναι η μπλόφα για την οποία γνωρίζει ο αντίπαλος ότι είναι μόνο μπλόφα; 

[του Κώστα Βέργου]
https://t.co/y8mHgeLV8w

Τα γρανάζια της κρεατομηχανής έχουν αρχίσει να γυρίζουν. Ποιους θα αλέσει; Ποιοι θα γλιτώσουν; 
[Του Γιάννη Σιώτου]
https://t.co/uJFUubU6Uu

Σε τι είδους μεταμορφώσεις υπόκειται ο έρωτας και πώς γίνεται δύο άνθρωποι να ονειρεύονται τη συναισθηματική ολοκλήρωση και να καταλήγουν να ταλαντεύονται ανάμεσα σε επιβίωση και εξολόθρευση;
[Της Δήμητρας Αθανασοπούλου]
https://t.co/nexC1Eu6cf

Τι είδους ηθικό σύστημα είναι αυτό που κατατάσσει τα είδη στην ταξική πυραμίδα της (ανθρώπινης) βρώσης με βάση την τεκμαιρόμενη (σχεδόν ανθρώπινη) ευφυΐα τους, βάζοντας στην κορυφή τον σκύλο ή το χταπόδι και στον πάτο τις γαρίδες και μαρίδες; 

[ΚΙΜΠΙ]
https://t.co/q29dVlPtkl

Τέρμα λοιπόν οι μούντζες, οι «Παναγίες», τα γ...σταυρίδια, θα γίνουμε επιτέλους Ευρώπη; Τι, όχι;
[Του Μιχαήλ Άγγελου Κωνσταντόπουλου]
https://t.co/OtCy7jsBl7

Δεν είναι ντροπή αλήθεια την ώρα που ο ένας πολιτικός αρχηγός κάνει δώρο 35 χιλ. ευρώ, ο άλλος να τρέχει να εισπράξει 8,5 χιλ;
[Του Δημήτρη Κανελλόπουλου]
https://t.co/gWSxON8XiX

Να τα καταδικάσουμε όλα ή μόνο όσα δεν μας αρέσουν και με τα υπόλοιπα να κάνουμε πλάκα; Τι λέτε; 
[Του Δημήτρη Κανελλόπουλου]
https://t.co/IlAu8v2rt4

Aυτοδυναμία, σχετική πλειοψηφία ή συγκατοίκηση;

Ο Μακρόν κινδυνεύει να χάσει την απόλυτη πλειοψηφία μετά τη θεαματική άνοδο της αριστερής συμμαχίας. Η διαδικασία, τα σενάρια και η «μάχη» για τις έδρες
https://t.co/k0STAqonjL https://t.co/dvGMNCWNu7

Είναι χαρακτηριστικές οι τηλεοπτικές δηλώσεις του κ. Χατζηδάκη για μείωση των εκκρεμών συντάξεων στις 73.000 από τις 150.000 συντάξεις. Τι ακριβώς αποκρύπτει;

[της Χριστίνας Κοψίνη]
https://t.co/UjxVT9jyz0

Γνωρίζουν τις τραγικές ελλείψεις στην Πυροσβεστική ή παριστάνουν ότι όλα βαίνουν καλώς για χάρη του αφηγήματος της κυβέρνησης και του πρωθυπουργού;
[Της Βασιλικής Τζεβελέκου]
https://t.co/uC8VDKDzvv

Αφήνουν τους δημάρχους και τους περιφερειάρχες να βγάλουν τα κάστανα από τη φωτιά – τα ειδικά για την πυροπροστασία υπουργεία που έφτιαξαν, τι ρόλο βαράνε αλήθεια;
[Του Γιώργου Σταματόπουλου]
https://t.co/usq3UgrSNg

Τώρα, όμως, που σ’ τα εξήγησα, πρωθυπουργούλι μου, δεν θα ξαναμπερδευτείς - έτσι δεν είναι;

[της Νόρας Ράλλη]
https://t.co/QJUF7oVnPG

Αν διώχνεις τους πρόσφυγες για να μην έχεις φασίστες, τι είναι αυτό που σε διαφοροποιεί από το κτήνος το οποίο, υποτίθεται, μάχεσαι;
[του Δημήτρη Χριστόπουλου]
https://t.co/YOO40YYenB

Είναι λοιπόν αθώες οι λέξεις;
[Του Χρήστου Κάτσικα]
https://t.co/UaC5gFJnPO

Σε αρκετές από τις πρώην βρετανικές αποικίες, τη θυμούνται ως την προσωποποίηση ενός φριχτού καθεστώτος...
@xstefanou [ infowar ]
https://t.co/dt1jLpOhLW

Για ποια αποδοχή μιλάει, μας δουλεύει ο κ. Οικονόμου; Δηλαδή αν δεν είχε και αποδοχή, τι νούμερα θα έκανε και σε ποια θέση θα βρισκόταν η ΕΡΤ; Υπό το μηδέν;

[ του Δημ. Κανελλόπουλου ]
https://t.co/4QCbVFZvTW

Ποιος θυμάται πια τη Μαριάνα Ποντγκουρσκάγια-Βισεμιρσκάγια, το κορίτσι από τη Μαριούπολη που έγινε πρωτοσέλιδο παγκοσμίως, χωρίς κανείς να μάθει την πραγματική ιστορία της;

[του Γιώργου Τσιάρα]
https://t.co/XTf6dYnqpZ

Και ποιος θα βρεθεί από την άλλη να τους απαντήσει; Ευτυχώς οι διαβεβαιώσεις ώς τώρα λένε πως είναι όλοι ασφαλείς. Το γιατί όμως, ποιος θα το απαντήσει;

[του Μάριου Διονέλλη]
https://t.co/7yaQpg6yRH

Πόσοι φοιτητές πρέπει ακόμη να δαρθούν, να ψεκαστούν, να τους σπάσουν τα δόντια, προκειμένου οι πρυτανικές αρχές να πουν έστω μια λέξη συμπάθειας;

[του Απόστολου Λυκεσά]
https://t.co/VxoquJ37b3

Εχετε δει κάτι πιτσιρικάκια προσχολικής ηλικίας που είναι ντυμένα εντελώς... αλλοπρόσαλλα για τα ενήλικα γούστα μας;

[της Αρτέμιδος Σπηλιώτη]
https://t.co/DVfqxX070Q

Το ερώτημα είναι: ποιος βγαίνει τελικά κερδισμένος; Υπάρχει πρόταση για να σπάσει ο φαύλος κύκλος;

[Ανάλυση του Κυριάκου Πιερίδη]
https://t.co/dQMkKswHrB

Η ήττα είναι «νίκη», η παράδοση είναι «εκκένωση» - μήπως, λέω ’γώ, και η Ουκρανία είναι Ωκεανία;
[Του Γιώργου Τσιάρα]
https://t.co/361izRpxXP

Δεν του λένε ή δεν καταλαβαίνει ότι δεν μπορεί να έχει ανοικτά δύο τεράστια μέτωπα; 
[Του Τάσου Παππά]
https://t.co/R25IAqyXs8

Αλήθεια, αν τότε ο Γκοντάρ ήταν σωστός, τώρα άραγε τι είναι; Φιλοπουτινικός;
[Της Νόρας Ράλλη]
https://t.co/F0eSoIqjtP

Τι κάνει άραγε γι’ αυτά ο ζηλωτής της πανεπιστημιακής αστυνομίας και των βίαιων αστυνομικών επεμβάσεων πρύτανης;

[της Χριστίνας Κοψίνη]
https://t.co/Hg0vMOYpRC

[Παρασκήνια]
Στροφή από το κόμμα της Χαριλάου Τρικούπη ή προσωπική άποψη του Γιώργου Καμίνη;
https://t.co/a4pCAhVNld

[Παρασκήνια]
Ποιος θυμάται άραγε την Μαριέττα Γιαννάκου που έκρουε μέχρι το τέλος τον κώδωνα του κινδύνου; 

https://t.co/yDd6JdCDxs

Μήπως έχει υποτιμήσει το γεγονός ότι για τη Δύση η Τουρκία είναι πολυτιμότερος σύμμαχος; 
[Του Τάσου Παππά]
https://t.co/HidQUcczZz

Τι ρόλο έχει παίξει η εμμονή της πολιτικής ηγεσίας του ΥΠΠΟΑ στην «απόσπαση και επανατοποθέτηση» αρχαιοτήτων, όπως συμβαίνει με τα βυζαντινά ευρήματα στον σταθμό Βενιζέλου;
[Της Βασιλικής Τζεβελέκου] 
https://t.co/Qy457D22Qr

[Παρασκήνια]
Αλήθεια, τον περιβαλλοντικό αναλφαβητισμό που τους διακατέχει πώς θα τον γιορτάσουν;

https://t.co/N0c3T5IbY4

Από τι ακριβώς παραιτούνται αυτά τα «κακομαθημένα» παιδιά, όταν τα δύο τρίτα των επονομαζόμενων Millennials ή των Echo Boomers που άφησαν τις δουλειές τους προτάσσουν λόγους ψυχικής υγείας (έρευνα των Mind Share Partners);

[της Χριστίνας Κοψίνη]
https://t.co/AdOSDCnY6h

Η ΕΡΤ, ο Πρόεδρος της ΕΡΤ, πρέπει να δώσει απαντήσεις: με ποιο δικαίωμα διαφήμιζε το ΚΙΝΑΛ και «θάβει» τώρα τον ΣΥΡΙΖΑ; 
[Του Δημήτρη Κανελλόπουλου]
https://t.co/ejwsnEVKBD

Με τέτοια εξουσία και τέτοιον λαό πώς είναι δυνατόν να μη λέει «ναι» ο Μητσοτάκης σε ό,τι τον προστάζουν;
[Του Γιώργου Σταματόπουλου]
https://t.co/EdqZ9w65V7

Ποια δύναμη έσπρωξε τη γυναίκα στο κήρυγμα, ποιος μηχανισμός δούλεψε και την έστειλε στον συνήθως έρημο σταθμό να προειδοποιήσει -χαιρέκακα; με αγωνία για τον συνάνθρωπο που κινδυνεύει;- τον κόσμο για την επερχόμενη καταστροφή;
[Της Αρχοντίας Κάτσουρα]
https://t.co/QQp32dCKzX
